import gmpy2
import libnum
e = gmpy2.mpz(3)
n = gmpy2.mpz()
c = gmpy2.mpz(184706733600030961911836917506112422167545490484023895702890946835667701083139603160422181673643482375812680575389095142687410989330788033710088246782628789557043348703224329521695342998531932006194716597523162472306119232610211018033794397444557249275490146884605734496362904120178078821)

k = 0
while 1:
    res = gmpy2.iroot(c+k*n,e)    #c+k*n 开3次方根 能开3次方即可
    if(res[1] == True):
        print((libnum.n2s(int(res[0]))).decode()) #转为字符串
        break
    k=k+1


